INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2, 10046, 0.0, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, 0.0, 102301, 24001);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, 0.0, 102301, 24002);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2, 10046, 0.0, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, 0.0, 102301, 24003);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2, 10046, 0.0, 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, 0.0, 192201, 24004);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, 0.0, 192201, 24005);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2, 10046, 0.0, 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, 0.0, 192201, 24006);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2, 10046, 0.0, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, 0.0, 192301, 24007);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, 0.0, 192301, 24008);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2, 10046, 0.0, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, 0.0, 192301, 24009);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 1, 10046, 0.0, 0.0, "やった！", 501, 0.0, 192501, 24010);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 1, 10046, 0.0, 0.0, "勝ったよ！", 502, 0.0, 192501, 24011);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 1, 10046, 0.0, 0.0, "いい調子！", 503, 0.0, 192501, 24012);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 6, 10046, 0.0, 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, 0.0, 113501, 24013);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, 0.0, 113501, 24014);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, 0.0, 113501, 24015);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ダイチ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, 0.0, 192401, 24016);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ダイチ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, 0.0, 192401, 24017);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ダイチ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2, 10046, 0.0, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, 0.0, 192401, 24018);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ハツネ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2, 10046, 0.0, 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, 0.0, 113401, 24019);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ハツネ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2, 10046, 0.0, 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, 0.0, 113401, 24020);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ハツネ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, 0.0, 113401, 24021);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("カヤ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, 0.0, 106501, 24022);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("カヤ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, 0.0, 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, 0.0, 106501, 24023);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("カヤ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 6, 10046, 0.0, 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, 0.0, 106501, 24024);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アヤネ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 4, 10046, 0.0, 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, 0.0, 102301, 24025);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("アサヒ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2, 10046, 0.0, 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, 0.0, 192201, 24026);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("部員３", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 1, 10046, 0.0, 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, 0.0, 192301, 24027);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 1, 10046, 0.0, 0.0, "いい勝負だったよ\nまたやろうね", 521, 0.0, 192501, 24028);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, -360.0, 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, 0.0, 113501, 24029);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, -360.0, 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, 0.0, 113501, 24030);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2, 10046, -360.0, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, 0.0, 113501, 24031);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2, 10046, -360.0, 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, 0.0, 113501, 24032);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("ミサト", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1, 10046, -360.0, 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, 0.0, 113501, 24033);
